import React from 'react';
import { Container, Typography, Grid, Paper, Button, Box, AppBar, Toolbar, IconButton, Menu, MenuItem, CssBaseline } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { Menu as MenuIcon } from '@mui/icons-material';
import { Link } from 'react-router-dom';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function Showcase() {
  const [anchorEl, setAnchorEl] = React.useState(null);

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppBar position="static">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={handleMenuOpen}>
            <MenuIcon />
          </IconButton>
          <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={handleMenuClose}>
            <MenuItem component={Link} to="/showcase" onClick={handleMenuClose}>Showcase</MenuItem>
            <MenuItem component={Link} to="/pricing" onClick={handleMenuClose}>Pricing</MenuItem>
          </Menu>
          <Typography variant="h6" style={{ flexGrow: 1 }}>
            FlipVault
          </Typography>
          <Button color="inherit" component={Link} to="/login">Log in</Button>
        </Toolbar>
      </AppBar>
      <Container maxWidth="lg" sx={{ mt: 4, textAlign: 'center' }}>
        <Typography variant="h3" gutterBottom>
          How FlipVault Works
        </Typography>
        <Typography variant="h6" gutterBottom>
          Discover the benefits of using FlipVault.
        </Typography>
        <Grid container spacing={4} padding={4}>
          {[
            {
              title: 'Product Checks',
              description: 'Access to a comprehensive database of 200 products to maximize your success.',
            },
            {
              title: 'Free Vendors',
              description: 'Receive 3 vendor recommendations with every product check.',
            },
            {
              title: 'Discord Alerts',
              description: 'Stay ahead with real-time Discord alerts about the latest products.',
            },
          ].map((feature, index) => (
            <Grid item xs={12} md={4} key={index}>
              <Paper sx={{ p: 3, backgroundColor: 'background.paper' }}>
                <Typography variant="h5" gutterBottom>
                  {feature.title}
                </Typography>
                <Typography variant="body1" gutterBottom>
                  {feature.description}
                </Typography>
                <Button variant="outlined" color="inherit">
                  Learn More
                </Button>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </ThemeProvider>
  );
}

export default Showcase;
